import React from "react";
import styled from "styled-components";

const ShowProfiles = () => {
  const Container = styled.div``;
  const ProfileContainer = styled.div``;
  return (
    <Container>
      <ProfileContainer></ProfileContainer>
    </Container>
  );
};

export default ShowProfiles;
